import React, { Component } from 'react';
import Calculator from './components/calculator'
import './App.css';

class App extends Component {
  state = {
    amount: 0,
  }

  render() {
    return (
      <div className="App">
      <div className="Title">
      <header>
        <h1 style={titleStyle}>Working with React</h1>
      </header>
      </div>
        <Calculator/>
      </div>
    );
  }
}

const titleStyle = {
  textAlign: 'center',
  backgroundColor: 'grey',
}

export default App;
